def discover_poverty_students():
    poverty_students = []
    for i in range(len(students_consumption)):
        if students_consumption[i][2] >= 200 and students_consumption[i][2] <= 500:
            if students_consumption[i][3] < 7:
                poverty_students.append(students_consumption[i])
    print("贫困学生群体：", poverty_students)
    print("贫困学生群体人数：", len(poverty_students))
    poverty_students_ID = []
    for i in range(len(poverty_students)):
        poverty_students_ID.append(poverty_students[i][0])
    print(poverty_students_ID)
    return  poverty_students_ID

discover_poverty_students()


# 评估每个学生每个月的贫困指数
def statistic_poverty_index():
    xAxis_data = discover_poverty_students()
    month_array = [9, 10, 11, 12, 1]
    consumption_data = pd.read_csv(filepath_StudentsConsumption_Processed)
    poverty_index_all_array = []
    for i in range(len(month_array)):
        poverty_index_month_array = []
        consumption_data_month = consumption_data.drop(consumption_data[consumption_data['month'] != month_array[i]].index)

        # 计算该月内所有学生的平均消费次数
        consumption_data_month_groupbyStdID = consumption_data_month.groupby(['bf_StudentID']).count().reset_index()
        students_consume_time_all = 0
        for j in range(consumption_data_month_groupbyStdID.shape[0]):
            students_consume_time_all += consumption_data_month_groupbyStdID['PerSex'].iloc[j]
        aveTime = students_consume_time_all / consumption_data_month_groupbyStdID.shape[0]
        # print('所有学生该月平均消费次数', aveTime)

        # 计算所有学生这个月的平均消费总金额
        students_month_number = consumption_data_month_groupbyStdID.shape[0]
        students_consume_all = 0
        for j in range(consumption_data_month.shape[0]):
            students_consume_all += (0 - consumption_data_month['MonDeal'].iloc[j])
        aveConAll = students_consume_all / students_month_number
        # print('所有学生这个月的平均消费总金额', aveConAll)

        # 控制因子
        alpha = 0.8
        lambda_index = 0.667

        # 计算每个学生每个月的贫困指数
        for j in range(len(xAxis_data)):
            student_poverty_array_piece = []
            consumption_data_month_student = consumption_data_month.drop(consumption_data_month[consumption_data_month['bf_StudentID'] != xAxis_data[j]].index)

            # 计算这个学生消费次数
            stdT = consumption_data_month_student.shape[0]
            if stdT != 0:
                # 计算这个学生这个月每次消费的金额
                student_month_cost_all = 0
                for k in range(consumption_data_month_student.shape[0]):
                    student_month_cost_all += (0 - consumption_data_month_student['MonDeal'].iloc[k])
                stdAveCon = student_month_cost_all / stdT

                # 计算这个学生这个月平均消费总金额
                stdConAll = student_month_cost_all

                # 计算这个学生的贫困指数
                student_poverty_index = (stdT - aveTime * alpha) / (stdAveCon * (stdConAll - aveConAll * lambda_index)) * 100

                # 对学生的贫困指数异常值进行处理
                if student_poverty_index < 0:
                    student_poverty_index = 0
                if student_poverty_index > 70:
                    student_poverty_index = 70.32
                
                student_poverty_array_piece.append(str(xAxis_data[j]))
                student_poverty_array_piece.append(round(student_poverty_index, 2))
                poverty_index_month_array.append(student_poverty_array_piece)
        poverty_index_all_array.append(poverty_index_month_array)
    print("所有的贫困指数数据：", poverty_index_all_array)
    print("所有的贫困指数数据长度：", len(poverty_index_all_array))
    print("第一个月的：", poverty_index_all_array[0])

    json_data = {'studentID': xAxis_data, 'dataset': poverty_index_all_array}
    with open('../4.Application-Level-data/PovertyHelper7.json', "w") as file:
        json.dump(json_data, file)
    print("完成文件加载")

statistic_poverty_index()
